The groundbreaking Labyrinth game taken to the next level is now available on Google Play. Labyrinth 2 has sold more than 800.000 copies across stores and we are very proud to bring the experience to you!

    Game elements: Cannons, Bumpers, Multiple balls, Doors, Magnets, Fans, Resizers, Merry-Go-Rounds, Duplicators, Lasers and more...
    Create your own levels and share them instantly with your friends and the world
    Download and rate levels created by the community
    Awards for your achievements

What's in this version : (Updated : Sep 13, 2012)

    Fixed bug where progress was not saved
    Fixed crash on Galaxy S3, and some other xhdpi devices.
    Fixed black screen on Nexus 7 tab, Galaxy Tab, and other Tegra based devices.
    We greatly appreciate the detailed feedback we are getting, especially by email! We are working hard at fixing some problems from the initial release.

Required Android O/S : 2.3+



